// src/index.js
import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { AuthProvider } from './context/authContext'; // Import AuthProvider for authentication context

ReactDOM.render(
  <React.StrictMode>
    <AuthProvider>
      <App /> {/* Wrap App with AuthProvider to provide auth context */}
    </AuthProvider>
  </React.StrictMode>,
  document.getElementById('root') // Ensure you have a root element in your index.html
);
